import React, { useState } from 'react';
import axios from 'axios';

const SampleChoice: React.FC = () => {
  const [episodeNumber, setEpisodeNumber] = useState<number>(1);
  axios.get(`localhost:3000/episode_number`)
      .then(res => {
        const episode_number = res.data.episode_number;
        setEpisodeNumber(episode_number);
      })
  return (
    <h1 className="text-3xl font-bold underline mx-auto pl-10">
      <video width="320" height="240" autoPlay={true}>
        <source src={`videos/video_${episodeNumber==1?'one':'two'}_1.mp4`} type="video/mp4"/>
      </video>
    </h1>
  );
}

export default SampleChoice;
